    [],nt"revision_timestamp": "2015-08-21T22:53:21.881954",nt"name": "va-clinical-assessment-reporting-and-tracking-cart-program",nt"isopen":
    true,nt"url": null,nt"notes": "The mission of the VA Clinical Assessment
    Reporting and Tracking (CART) Program for cardiac catheterization laboratories (CART-CL)
    is to support a national VA reporting system, data repository, and quality improvement
    program for procedures performed in VA cardiac catheterization laboratories. CART-CL
    is intended to improve clinical care/communication, support local and national quality
    improvement, monitor patient safety, capture workload of cardiac catheterization
    lab procedures, and inform VA system evaluation to maximize operational efficiency
    and patient outcomes. CART-CL is a collaborative effort between the VA Patient Care
    Services, Office of Information and Analytics, Ischemic Heart Disease Quality Enhancement
    Research Initiative (IHD-QUERI), and Office of Information and Technology (OI&T).",nt"license_title":
